ao Kahn, who lost to Liu Kang in the Outworld tournament in the previous game, enacts a 10,000-year-old plan. He would have his Shadow Priests, led by Shang Tsung, revive his former Queen Sindel, who unexpectedly died at a young age.'),(144,'Mortal Kombat II','mortalkombatii.png','mortalkombatii.png',3,NULL,'Following his failure to defeat Liu Kang in the previous Mortal Kombat tournament, the evil Shang Tsung begs his master Shao Kahn, supreme ruler of Outworld and the surrounding kingdoms, to spare his life. He tells Shao Kahn that if they hold the next Mortal Kombat Tournament in Outworld.'),(145,'Mortal Kombat','mortalkombat.jpg','mortalkombat.png',3,NULL,'The game takes place in Earthrealm, where a tournament is being held on Shang Tsung\'s Island, on which seven of its locations serve as stages in the game.'),(146,'Mr.Nutz','mr.nutz.png','mr.nutz.jpg',3,NULL,'Mr. Nutz, an anthropomorphic red squirrel wearing Chucks, gloves, a vest, and a cap, through six themed levels. The end goal is to stop Mr. Blizzard.'),(147,'Mutant League Football','mutantleaguefootball.png','mutantleaguefootball.jpg',3,NULL,'During a football game, an earthquake reveals buried toxic waste, and the fumes cause all of the attendees and players to mutate. A sports federation based around the superhuman beings, the Mutant League, springs up.'),(148,'NBA Hangtime','nbahangtime.png','nbahangtime.jpg',3,NULL,'NBA Basketball simulation game'),(149,'Olympic Summer Games','olympicsummergames.jpg','olympicsummergames.jpg',3,NULL,'Olympic game events 100m, Swimming and more...'),(150,'Pitfall: The Mayan Adventure','pitfall:themayanadventure.jpg','pitfall:themayanadventure.png',3,NULL,'Harry Jr. must fight to save his father Pitfall Harry though jungles.'),(151,'Pitfighter','pitfighter.jpg','pitfighter.jpg',3,NULL,'Venture deep into the hidden world of the under-city to battle the world\'s toughest brawlers! In Pit-Fighter, the only rule is to survive.'),(152,'Populous','populous.jpg','populous.png',3,NULL,'God like game where you can use the power of light or the force of darkness? You decide! The Ice World - One of the four totally different landscapes. Use Nature\'s Creations - Swamps, earthquakes or volcanoes... at your fingertips.'),(153,'Road Rash','roadrash.jpg','roadrash.png',3,NULL,'Motorcycle cross country racing game with weapons'),(154,'Sonic and Knuckles','sonicandknuckles.jpg','sonicandknuckles.png',3,NULL,'The story begins immediately after the events of Sonic 3, where Dr. Robotnik\'s orbital weapon, the Death Egg, is damaged in a battle with Sonic and crash-lands back onto Angel Island. Sonic travels through each zone looking to retrieve the Chaos Emeralds to defeat Robotnik, and once again comes into conflict with Knuckles, who believes Sonic is trying to steal the Emeralds for himself.'),(155,'Sonic The Hedgehog 2','sonicthehedgehog2.jpg','sonicthehedgehog2.png',3,NULL,'Sonic\'s nemesis, Dr. Ivo Robotnik, is planning world domination through the power of the Chaos Emeralds and an army of robots powered by trapped animals. Specific to this game, he is additionally constructing an armored space station known as the Death Egg'),(156,'Sonic The Hedgehog 3','sonicthehedgehog3.jpg','sonicthehedgehog3.png',3,NULL,'Tthe Death Egg, crash-lands on the floating Angel Island. There, Robotnik meets Knuckles the Echidna, the last member of an ancient echidna civilization that once inhabited the island. Knuckles is the guardian of the Master Emerald.'),(157,'Sonic The Hedgehog ','sonicthehedgehog.jpg','sonicthehedgehog.png',3,NULL,'In an attempt to steal the six Chaos Emeralds and harness their power, the evil Dr. Ivo Robotnik[b] has trapped the animal inhabitants of South Island in aggressive robots and stationary metal capsules.'),(158,'Street Fighter II','streetfighterii.png','streetfighterii.png',3,NULL,'From across the globe comes eight of the wildest fighters the world has ever known. Choose your champion, gather your courage and prepare to battle your opponents in a bare knuckle brawl.'),(159,'Streets Of Rage 2','streetsofrage2.png','streetsofrage2.gif',3,NULL,'Skate was shocked to find his house in ruin and his older brother missing. Attached to the front door was a picture of Adam chained to a wall at the feet of Mr. X. The criminals began to retake the streets once more.'),(160,'Streets Of Rage','streetsofrage.jpg','streetsofrage.png',3,NULL,'The once peaceful city has been taken over by a criminal syndicate, including factions of the police. Mass violence is now common and no one is safe.'),(161,'Streets of Rage 3','streetsofrage3.jpg','streetsofrage3.png',3,NULL,'After being defeated twice, Syndicate crime boss Mr. X has started a research company called RoboCy Corporation to act as a cover for his illegal activities. The world\'s best roboticist, Dr. Dahm.'),(162,'Talespin','talespin.jpg','talespin.png',3,NULL,'Soar into the wild blue yonder with Kit and Baloo, your madcap buddies. Scramble to win the world\'s zaniest flying contest ever, in Higher for Hire\'s famous flying machine, the Sea Duck.'),(163,'Team USA Basketball','teamusabasketball.jpg','teamusabasketball.jpg',3,NULL,'Basketball simulation game'),(164,'The Lion King','thelionking.png','thelionking.png',3,NULL,'Based on Disney\'s The Lion King film.'),(165,'Tiny Toon Adventures: Acme All-Stars','tinytoonadventures:acmeall-stars.jpg','tinytoonadventures:acmeall-stars.jpg',3,NULL,'Now those crazy Tiny Toon Adventures characters are creating sporting havoc! Create teams from amongst your favorite toons.'),(166,'Toe Jam and Earl','toejamandearl.png','toejamandearl.png',3,NULL,'Help us hunt down the pieces to our rocket ship and we\'ll let you jam out some tunes on our megawatt rapmaster.'),(167,'Vectorman','vectorman.jpg','vectorman.jpg',3,NULL,'By the year 2049, Earth has been turned into a toxic waste dump! Humankind has fled into space leaving behind an army of mechanized \"Orbots\" to clean up the mess!'),(168,'Zombies Ate My Neighbors','zombiesatemyneighbors.jpg','zombiesatemyneighbors.jpg',3,NULL,'One or two players take control of protagonists Zeke and Julie in order to rescue the titular neighbors from monsters often seen in horror movies.'),(169,'Quest 64','quest64.jpg','quest64.jpg',4,NULL,'Brian sets off to find his father, who has left the monastery of the mages.'),(170,'The Legend Of Zelda: Majoras Mask','thelegendofzelda:majorasmask.jpg','thelegendofzelda:majorasmask.jpg',4,NULL,'Link searching for his departed fairy, Navi.[21] While riding through a forest in Hyrule on his horse Epona, Link is ambushed by the masked Skull Kid and his fairy friends Tatl and Tael, who steal both Epona and the Ocarina of Time.'),(171,'The Legend Of Zelda: Ocarina Of Time','thelegendofzelda:ocarinaoftime.png','thelegendofzelda:ocarinaoftime.jpg',4,NULL,'The fairy Navi awakens Link from a nightmare in which he witnesses a man in black armor pursuing a young girl on horseback. Navi brings Link to the Great Deku Tree, who is cursed and near death.'),(172,'WCW NWO Revenge','wcwnworevenge.jpg','wcwnworevenge.jpg',4,NULL,'Pro Wrestling simulation game.'),(173,'WCW vs. NWO: World Tour','wcwvs.nwo:worldtour.jpg','wcwvs.nwo:worldtour.png',4,NULL,'Pro Wrestling simulation game.'),(174,'WWF No Mercy','wwfnomercy.jpg','wwfnomercy.png',4,NULL,'Pro Wrestling simulation game.'),(175,'WWF Wrestlemania 2000','wwfwrestlemania2000.jpg','wwfwrestlemania2000.jpg',4,NULL,'Pro Wrestling simulation game.'),(176,'Cook Wars','cookwars.jpg','cookwars.jpg',5,NULL,'Cooking simulation game.'),(177,'Disney Sing It Family Hits','disneysingitfamilyhits.jpg','disneysingitfamilyhits.jpg',5,NULL,'Singing game with Disney songs'),(178,'Dora Save The Snow Princess','dorasavethesnowprincess.jpeg','dorasavethesnowprincess.jpeg',5,NULL,'Dora,Boots and the gang are trying to save the Snow Princess'),(179,'Just Dance 2','justdance2.png','justdance2.jpg',5,NULL,'Dancing simulation game'),(180,'Madagascar Kartz','madagascarkartz.jpg','madagascarkartz.jpg',5,NULL,'Racing game with characters from the Madagascar cartoon'),(181,'Mario and Sonic Olympic Winter Games','marioandsonicolympicwintergames.jpg','marioandsonicolympicwintergames.jpg',5,NULL,'Winter Olympic sporting events featuring characters from Nintendo and featuring Sonic the Hedgehog'),(182,'Mario Kart Wii','mariokartwii.jpg','mariokartwii.jpg',5,NULL,'Racing simulation based on Nintendo characters.'),(183,'Mario Party 8','marioparty8.jpg','marioparty8.jpg',5,NULL,'Party video game series featuring characters from the Mario franchise in which up to four local players or computer-controlled characters compete in a board game interspersed with minigames.'),(184,'Michael Jackson The Experience','michaeljacksontheexperience.png','michaeljacksontheexperience.jpg',5,NULL,'Dancing simulation game.'),(185,'My Sims Kingdom','mysimskingdom.jpg','mysimskingdom.jpg',5,NULL,'King Roland needs your help to make the Kingdom a better place. Throughout this tale to bring the Kingdom back to its former glory.'),(186,'Sim Animals','simanimals.jpg','simanimals.jpg',5,NULL,'Embrace all the adventure, fun, and mischief that await you in the vast forest. You have the power to reach out and touch, pick up and move everything in the forest from squirrels and foxes to trees and flowers.'),(187,'Sims Animals Africa','simsanimalsafrica.jpg','simsanimalsafrica.jpeg',5,NULL,'Journey to the heart of Africa where you control the wild kingdom! Interact with exotic animals in the wild including lions, elephants, gorillas and more as you explore the jungles and savannas of Africa.'),(188,'Super Mario Bros Wii','supermariobroswii.png','supermariobroswii.jpg',5,NULL,'When Mario, Luigi, Yellow Toad, and Blue Toad are celebrating Princess Peach\'s birthday in her castle, a large cake appears. Bowser Jr. and the Koopalings emerge from the cake and trap Peach inside.'),(189,'Toystory 3','toystory3.jpg','toystory3.jpg',5,NULL,'Video game based on ToyStory 3 movie.'),(190,'Wii Play','wiiplay.jpg','wiiplay.jpeg',5,NULL,'A few mini games.'),(191,'Wii Sports Resort','wiisportsresort.jpg','wiisportsresort.jpg',5,NULL,'Waterskiing, biking and more.'),(192,'Mario Kart 8 Delux','mariokart8delux.jpg','mariokart8delux.jpg',6,'mariokart8delux.jpg','Racing simulation based on Nintendo characters.'),(193,'Mario Tennis Aces','mariotennisaces.jpg','mariotennisaces.jpg',6,NULL,'Tennis simulation with characters from the Marion universe.'),(194,'Super Mario Party','supermarioparty.jpg','supermarioparty.jpg',6,NULL,'Party video game series featuring characters from the Mario franchise in which up to four local players or computer-controlled characters compete in a board game interspersed with minigames.'),(195,'Yoshi\'s Crafted World','yoshi\'scraftedworld.jpg','yoshi\'scraftedworld.jpg',6,NULL,'The story begins with the Yoshis, who live peacefully on Yoshi\'s Island. At the topmost peak of the island sits a gem-set artifact known as the Sundream Stone, which possesses the power to \"make anyone\'s wildest dreams come true\".'),(196,'Age Of Empires II The Age Of Kings','ageofempiresiitheageofkings.png','ageofempiresiitheageofkings.jpg',7,NULL,'You have one thousand years to lead a civilization into greatness. Age of Empires II: The Age of Kings puts you in command of one of 13 civilizations from the fall of Rome through the Middle Ages.'),(197,'Age Of Empires','ageofempires.jpg','ageofempiresiitheageofkings.jpg',7,NULL,'Age of Empires is an epic real-time strategy game spanning 10,000 years, in which players are the guiding spirit in the evolution of small stone age tribes.'),(198,'Command & Conquer Red Alert','command&conquerredalert.jpg','command&conquerredalert.jpg',7,NULL,'Command & Conquer: Red Alert takes place in a parallel universe. At the Trinity Site in New Mexico in 1946, Albert Einstein prepares to travel backward in spacetime. He activates his experimental time machine to find himself in Landsberg, Germany, on December 20, 1924, where he meets a young Adolf Hitler just after the latter\'s release from Landsberg Prison. Following a brief conversation between the two, Einstein shakes Hitler\'s hand, which erases him from the timeline.'),(199,'Final Fantasy VII','finalfantasyvii.jpg','finalfantasyvii.jpg',7,NULL,'Gaia the planet\'s lifeforce, called the Lifestream, is a flow of spiritual energy that gives life to everything on the Planet. Its processed form is known as \"Mako\".On a societal and technological level, the game has been defined as an industrial or post-industrial science fiction milieu. The Planet\'s Lifestream is being drained for energy by the Shinra Electric Power Company.'),(200,'Rollercoaster Tycoon 3','rollercoastertycoon3.jpg','rollercoastertycoon3.jpg',7,NULL,'Create a theme park and manage.'),(201,'Rollercoaster Tycoon','rollercoastertycoon.jpg','rollercoastertycoon.jpg',7,NULL,'Create a theme park and manage'),(202,'The Sims 3','thesims3.jpg','thesims3.jpg',7,NULL,'Life simulation video game'),(203,'The Sims ','thesims.png','thesims.jpg',7,NULL,'Life simulation video game'),(204,'Dance Dance Revolution Mario Mix','dancedancerevolutionmariomix.jpg','dancedancerevolutionmariomix.jpg',8,NULL,'Dance simulation game with characters from Nintendo\'s Mario games'),(205,'Lego Starwars 2','legostarwars2.png','legostarwars2.jpg',8,NULL,'Lego game spanning Star Wars Episode IV, V, and VI.'),(206,'Lego Starwars','legostarwars2.png','legostarwars2.jpg',8,NULL,'Lego game spanning Star Wars Episode I, II and III'),(207,'Mario Golf Toadstool Tour','mariogolftoadstooltour.jpg','mariogolftoadstooltour.jpg',8,NULL,'Golf simulation game featuring characters from Mario games.'),(208,'Mario Party 5','marioparty5.jpg','marioparty5.jpg',8,NULL,'Party video game series featuring characters from the Mario franchise in which up to four local players or computer-controlled characters compete in a board game interspersed with minigames.'),(209,'Mario Party 7','marioparty7.jpg','marioparty7.jpg',8,NULL,'Party video game series featuring characters from the Mario franchise in which up to four local players or computer-controlled characters compete in a board game interspersed with minigames.'),(210,'Scooby-Doo Mystery Mayhem','scooby-doomysterymayhem.jpg','scooby-doomysterymayhem.jpg',8,NULL,'When Scooby and the gang discover someone has released thousands of real ghosts and monsters from a magic book called The Tome of Doom, they race to solve mysteries and put the monsters back.'),(211,'Soul Calibur 2','soulcalibur2.jpg','soulcalibur2.png',8,NULL,'The game is set in the year 1590, four years after the events of Soulcalibur. The wave of slaughters that terrorized Europe reached a sudden end. The knight in azure armor, Nightmare, and his followers were successful in collecting enough souls and were about to start the restoring ceremony on the ruins of the once-proud Ostreinsburg Castle.'),(212,'Super Mario Strikers','supermariostrikers.jpg','supermariostrikers.jpg',8,NULL,'Soccer simulation featuring characters from the Nintendo Mario Bros franchise.'),(213,'Tarzan Untamed','tarzanuntamed.jpg','tarzanuntamed.jpeg',8,NULL,'Picking up quite a while after the defeat of Clayton, Jane and Professor Archimedes Q. Porter now speak Gorilla-language fluently and Jane is married to Tarzan. However, their lives are threatened once again by a brutal band of British explorers.'),(214,'The Legend Of Zelda Four Swords Adventures','thelegendofzeldafourswordsadventures.jpg','thelegendofzeldafourswordsadventures.png',8,NULL,'The game begins with the land of Hyrule in a state of fear because of strange happenings that have occurred recently. On a stormy night, Princess Zelda and the shrine maidens fear that the reason for these events is that Vaati\'s seal is weakening. She summons Link and brings him to the castle so he can protect her.'),(215,'The Legend Of Zelda Twilight Princess','thelegendofzeldatwilightprincess.jpg','thelegendofzeldatwilightprincess.jpg',8,NULL,'The game begins with a youth named Link, who works as a ranch hand in Ordon Village. One day, Bulblins, take away the village\'s children. Link pursues and encounters a wall of Twilight.'),(216,'Akuji The Heartless','akujitheheartless.png','akujitheheartless.jpg',10,NULL,'The game centres on the voodoo priest and warrior Akuji, who had his heart ripped out on his wedding day, and through the use of voodoo magic is now cursed to wander the Underworld.'),(217,'Bloodyroar II','bloodyroarii.jpg','bloodyroarii.png',10,NULL,'Five years after the events of the first game, the zoanthropes who had gotten involved in the conflict against the fallen Tylon Corporation have since resumed their normal and peaceful lives. However, the peace does not last long.'),(218,'Bloodyroar','bloodyroar.png','bloodyroar.png',10,NULL,'Get ready to stake your ground and confront your destiny because you\'re in for a fast and fierce, one on one blood match.'),(219,'Brave Fencer Musashi','bravefencermusashi.jpg','bravefencermusashi.jpg',10,NULL,'A boy known as Musashi, reincarnated from the legendary Brave Fencer Musashi who saved the Allucaneet Kingdom from a monster called the Wizard of Darkness 150 years before, is summoned to Allucaneet by its ruler Princess Fillet to save it from the invading Thirstquencher Empire.'),(220,'Breath Of Fire IV','breathoffireiv.png','breathoffireiv.png',10,NULL,'The story of Breath of Fire IV begins with a search team consisting of Nina, princess of the Kingdom of Wyndia, and Cray, leader from the plains-dwelling Woren clan.'),(221,'Bushido Blade 2','bushidoblade2.png','bushidoblade2.jpg',10,NULL,'In the 13th century, on the island of Konoshima there existed two feudal clans, the Kagami and the Sue, both aligned to the same Daimyo. They lived in peace until war on mainland Japan.'),(222,'Bushido Blade','bushidoblade.jpg','bushidoblade.jpg',10,NULL,'A fictional, 500-year-old dojo known as Meikyokan lies within this region, and teaches the disciplines of the master Narukagami Shinto. A society of assassins known as Kage (\"Shadow\") also resides within the dojo.'),(223,'Chrono Cross','chronocross.jpg','chronocross.png',10,NULL,'The game begins with Serge located in El Nido, a tropical archipelago inhabited by ancient natives, mainland colonists, and beings called Demi-humans. Serge slips into an alternate dimension in which he drowned on the beach ten years prior, and meets the thief, \"Kid\".'),(224,'College Slam','collegeslam.jpg','collegeslam.jpg',10,NULL,'College basketball simulation'),(225,'Cool Boarders 2','coolboarders2.jpeg','coolboarders2.png',10,NULL,'Snowboarding game.'),(226,'Cool Boarders 3','coolboarders3.jpg','coolboarders3.jpg',10,NULL,'Snowboarding game.'),(227,'Crash Bandicoot','crashbandicoot.png','crashbandicoot.png',10,NULL,'In a southeast Australian archipelago, Doctor Neo Cortex and his assistant Doctor Nitrus Brio use a device called the Evolvo-Ray to mutate the various animals living on the islands into beasts with superhuman strength. They experiment on Crash, a peaceful bandicoot.'),(228,'Diablo','diablo.png','diablo.jpg',10,NULL,'Set in the fictional Kingdom of Khanduras in the mortal realm, the player controls a lone hero battling to rid the world of Diablo, the Lord of Terror. Beneath the town of Tristram, the player journeys through sixteen randomly generated dungeon levels, ultimately entering Hell in order to face Diablo.'),(229,'Dino Crisis 2','dinocrisis2.jpg','dinocrisis2.jpg',10,NULL,'After the events of the previous game, unsafe research into time-distorting Third Energy has resulted in an entire research base, military institution, and fictional metropolis of Edward City to be transported to another time; along with all of its inhabitants.'),(230,'Driver 2','driver2.jpg','driver2.jpg',10,NULL,'The game begins in a bar in Chicago, where a man named Pink Lenny is talking to a tattooed Brazilian man. Two gangsters suddenly enter the bar and open fire on them.'),(231,'Driver','driver.png','driver.png',10,NULL,'NYPD officer and former racing driver John Tanner is sent undercover by his boss Lieutenant McKenzie to discover the intentions of a crime syndicate led by Castaldi. McKenzie instructs Tanner to go to Miami and meet a pimp named Rufus.'),(232,'Final Fantasy Anthology','finalfantasyanthology.jpg','finalfantasyanthology.jpg',10,NULL,'Final Fantasy V and Final Fantasy VI for the PS1'),(233,'Final Fantasy Chronicles','finalfantasychronicles.jpg','finalfantasychronicles.jpg',10,NULL,'Final Fantasy IV and Chrono Trigger for the PS1'),(234,'Final Fantasy Crystal Chronicles','finalfantasycrystalchronicles.jpg','finalfantasycrystalchronicles.png',8,NULL,'Takes place in an unnamed fantasy world inhabited by four races. The player takes control of a caravan hailing from the village of Tipa, in which members of the world\'s four races come together to help its mission.'),(235,'Final Fantasy IX','finalfantasyix.jpg','finalfantasyix.png',10,NULL,'In Alexandria, Zidane and Tantalus kidnap Princess Garnet by order of Cid. Garnet does not resist, for she was already planning to flee and warn Cid of Queen Brahne\'s increasingly erratic behavior.Vivi and Steiner join the party during the escape.'),(236,'Final Fantasy Tactics','finalfantasytactics.jpg','finalfantasytactics.jpg',10,NULL,'The story takes place after Ivalice ended its war with the two nations in what is known as the Fifty Years War, and is facing economic problems and political strife.'),(237,'Final Fantasy VIII','finalfantasyviii.jpg','finalfantasyviii.png',10,NULL,'Squall and Seifer spar each other while training outside Balamb Garden. Meanwhile, the Republic of Galbadia invades the Dollet Dukedom, forcing Dollet to hire SeeD.'),(238,'Final Fantasy VII','finalfantasyvii.jpg','finalfantasyvii.png',10,NULL,'Gaia the planet\'s lifeforce, called the Lifestream, is a flow of spiritual energy that gives life to everything on the Planet. Its processed form is known as \"Mako\".On a societal and technological level, the game has been defined as an industrial or post-industrial science fiction milieu. The Planet\'s Lifestream is being drained for energy by the Shinra Electric Power Company.'),(239,'Gran Turismo 2','granturismo2.jpg','granturismo2.jpg',10,NULL,'Racing simulation game.'),(240,'Gran Turismo','granturismo.jpg','granturismo.jpg',10,NULL,'Racing simulation game.'),(241,'Heart Of Darkness','heartofdarkness.png','heartofdarkness.png',10,NULL,'Andy being abused by his teacher for sleeping in class where it is revealed that he has nyctophobia (fear of the dark). Being instructed that same day by his teacher to watch the solar eclipse, Andy takes his beloved dog Whisky to the park where dark forces steal Whisky away.'),(242,'Jade Cocoon Story Of The Tamamayu','jadecocoonstoryofthetamamayu.jpg','jadecocoonstoryofthetamamayu.jpg',10,NULL,'Levant, a young man who lives in the town of Syrus. The silent protagonist is guided by the player on his quest to follow in his presumably dead father\'s footsteps to become a Cocoon Master.'),(243,'Knockout Kings 2001','knockoutkings2001.jpg','knockoutkings2001.jpg',10,NULL,'Boxing simulation game'),(244,'Knockout Kings 99','knockoutkings99.jpg','knockoutkings99.png',10,NULL,'Boxing simulation game'),(245,'Legend Of Dragoon','legendofdragoon.jpg','legendofdragoon.jpg',10,NULL,'The story begins when Dart, the protagonist, is heading home from a five year long journey to pursue the Black Monster, a being that killed his parents and destroyed his birth city, Neet. On the way, he is attacked by a mantis-like dragon controlled by the Sandora, a rebel faction in the Serdian civil war.'),(246,'Legend Of Legaia','legendoflegaia.png','legendoflegaia.jpg',10,NULL,'Vahn sets out on a quest to rid the world of The Mist by reviving Genesis Trees and destroying Mist Generators. Along the way, he recruits party members Noa and Gala, and discovers the origin of The Mist.'),(247,'Madden NFL 2001','maddennfl2001.jpg','maddennfl2001.jpg',10,NULL,'NFL football simulation game'),(248,'Metal Gear Solid','metalgearsolid.png','metalgearsolid.jpg',10,NULL,'The year is 2005, six years after the downfall of Zanzibarland.[23] A renegade genetically-enhanced special forces unit, FOXHOUND, has seized a remote island in Alaska\'s Fox Archipelago codenamed \"Shadow Moses\", the site of a nuclear weapons disposal facility.'),(249,'Metal Slug','metalslug.jpg','metalslug.png',10,NULL,'It was the year 2028. The evil General Morden and his rebel army has launched a coup d\'etat on the world\'s governments, and all attempts by the armies of the various countries to curtail his growing power fail.'),(250,'MLB\'98','mlb\'98.png','mlb\'98.jpeg',10,NULL,'Major League Baseball simulation game'),(251,'Mortal Kombat 4','mortalkombat4.jpg','mortalkombat4.png',10,NULL,'Thousands of years before the setting of the first game, Shinnok, one of the Elder Gods who control the six realms in the Mortal Kombat universe, attempted to become the conqueror of them all.'),(252,'NBA Live 2000','nbalive2000.jpg','nbalive2000.png',10,NULL,'Pro basketball simulation game.'),(253,'NBA Live 96','nbalive96.jpg','nbalive96.jpg',10,NULL,'Pro basketball simulation game.'),(254,'NBA Live 97','nbalive97.jpg','nbalive97.png',10,NULL,'Pro basketball simulation game.'),(255,'NBA Live 98','nbalive98.jpg','nbalive98.jpg',10,NULL,'Pro basketball simulation game.'),(256,'NCAA Football 2000','ncaafootball2000.png','ncaafootball2000.jpg',10,NULL,'College football simulation game.'),(257,'NCAA Football 2001','ncaafootball2001.jpg','ncaafootball2001.jpg',10,NULL,'College football simulation game.'),(258,'NCAA Football 98','ncaafootball98.gif','ncaafootball98.jpg',10,NULL,'College football simulation game.'),(259,'NCAA Football 99','ncaafootball99.jpg','ncaafootball99.jpg',10,NULL,'College football simulation game.'),(260,'NCAA Gamebreaker 98','ncaagamebreaker98.jpg','ncaagamebreaker98.jpg',10,NULL,'College football simulation game.'),(261,'NCAA March Madness 98','ncaamarchmadness98.jpg','ncaamarchmadness98.jpg',10,NULL,'College basketball simulation game.'),(262,'NCAA March Madness 99','ncaamarchmadness99.jpg','ncaamarchmadness99.jpg',10,NULL,'College basketball simulation game.'),(263,'NFL Gameday 97','nflgameday97.jpg','nflgameday97.jpg',10,NULL,'Pro football simulation game.'),(264,'NFL Gameday 98','nflgameday98.jpeg','nflgameday98.jpg',10,NULL,'Pro football simulation game.'),(265,'Olympic Summer Games','olympicsummergames.jpg','olympicsummergames.jpg',10,NULL,'100m, 200m dash and other Olympic Games'),(266,'Parasite Eve II','parasiteeveii.png','parasiteeveii.jpg',10,NULL,'The game opens to reveal Aya Brea, the protagonist of the original Parasite Eve game, who is now an FBI operative in their Mitochondrial Investigation and Suppression Team (MIST) being dispatched on an urgent mission in central Los Angeles, where there have been reports of NMC sightings.'),(267,'Parasite Eve','parasiteeve.png','parasiteeveii.jpg',10,NULL,'The player takes on the role of Aya Brea, an NYPD rookie,attending an opera at Carnegie Hall with a blind date in New York City on Christmas Eve 1997. During the opera, everyone in the building spontaneously combusts, except for Aya, and an actress on stage named Melissa Pearce.'),(268,'Resident Evil 2','residentevil2.png','residentevil2.png',10,NULL,'On September 29, 1998, two months after the events of the first Resident Evil,most citizens of the Midwestern American mountain community Raccoon City have been transformed into zombies by the T-virus, a biological weapon secretly developed by the pharmaceutical company Umbrella.'),(269,'Resident Evil 3 Nemesis','residentevil3nemesis.jpg','residentevil3nemesis.png',10,NULL,'On September 28, 1998, 24 hours prior to the events of Resident Evil 2, former Special Tactics And Rescue Service (S.T.A.R.S.) member Jill Valentine attempts to escape from Raccoon City. Most of the population has been transformed into zombies by an outbreak of the T-virus, a new type of biological weapon secretly developed by the pharmaceutical company Umbrella.'),(270,'Resident Evil Director\'s Cut Dualshock Ver','residentevildirector\'scutdualshockver.jpg','residentevildirector\'scutdualshockver.jpg',10,NULL,'On July 24, 1998, when a series of bizarre murders occur on the outskirts of the Midwestern town of Raccoon City, the Raccoon City Police Department\'s S.T.A.R.S. team are assigned to investigate.'),(271,'Resident Evil Director\'s Cut','residentevildirector\'scut.jpeg','residentevildirector\'scut.jpg',10,NULL,'On July 24, 1998, when a series of bizarre murders occur on the outskirts of the Midwestern town of Raccoon City, the Raccoon City Police Department\'s S.T.A.R.S. team are assigned to investigate.'),(272,'Resident Evil','residentevildirector\'scut.jpeg','residentevildirector\'scut.jpg',10,NULL,'On July 24, 1998, when a series of bizarre murders occur on the outskirts of the Midwestern town of Raccoon City, the Raccoon City Police Department\'s S.T.A.R.S. team are assigned to investigate.'),(273,'Silent Hill','silenthill.png','silenthill.jpg',10,NULL,'Harry Mason as he searches for his missing adopted daughter in the mysterious town of Silent Hill. Stumbling upon a cult conducting a ritual to revive a deity it worships.'),(274,'Silent Hill 2','silenthill2.jpg','silenthill2.jpg',11,NULL,'James Sunderland searching for his deceased wife in Silent Hill after having received a letter from her informing him that she is waiting for him there.'),(275,'Suikoden II','suikodenii.jpg','suikodenii.jpg',10,NULL,'The player and his childhood friend Jowy Atreides working together as members of the youth division of the Highland Army. Luca Blight, the prince of Highland, and Captain Rowd, the player\'s commanding officer, orchestrate the slaughter of the player\'s and Jowy\'s unit and blame it on the neighboring city-state of Jowston, giving the prince an excuse to invade Jowston. The player and Jowy escape the slaughter by jumping off a cliff into a river.'),(276,'Sydney 2000','sydney2000.jpg','sydney2000.jpg',10,NULL,'Olympic games simulation, 100m dash,swimming, diving and more'),(277,'Syphon Filter 2','syphonfilter2.jpg','syphonfilter2.png',10,NULL,'The plot picks up immediately after where the previous Syphon Filter ended. Gabe sets out to cure the virus while being targeted as a terrorist by the US government.'),(278,'Syphon Filter 3','syphonfilter3.jpg','syphonfilter3.jpg',10,NULL,'Gabe and his team are suspected of treason. Summoned to prove their innocence, the team recounts the incidence that led to this moment. In the background, Gabe moves to rid the world of Syphon Filter once and for all.'),(279,'Syphon Filter','syphonfilter.jpg','syphonfilter.jpg',10,NULL,'The plot centers on special agents Gabriel Logan and Lian Xing who are tasked by the United States government to apprehend an international terrorist named Erich Rhoemer.'),(280,'Tekken','tekken.jpg','tekken.png',10,NULL,'When Kazuya Mishima is five years old, his father Heihachi Mishima, after he killed his mother, carries him to the top of a mountain and callously throws him off a cliff to test his son\'s strength, whether he is fit to lead the Mishima Zaibatsu, the family business, and to see if he will be able to climb back up the same cliff.'),(281,'Tenchu Stealth Assassins','tenchustealthassassins.jpg','tenchustealthassassins.jpg',10,NULL,'The game takes place in feudal Japan,introducing a pair of ninja: Rikimaru and Ayame, members of the Azuma Ninja Clan since childhood. The two ninja serve the heroic Lord Gohda, and work for him as his secret spies to root out corruption and gather intelligence in his province.'),(282,'The X Files','thexfiles.jpg','thexfiles.jpg',10,NULL,NULL),(283,'Tomb Raider 2','tombraider2.jpeg','tombraider2.jpg',10,NULL,'The mythical \'Dagger of Xian\', a weapon which was used by an Emperor of China to command his army. By plunging the weapon into its owner\'s heart, the weapon has the power to turn its bearer into a dragon.'),(284,'Tomb Raider','tombraider.jpg','tombraider.png',10,NULL,'Archaeologist-adventurer Lara Croft is approached by Larson, who is working for the wealthy businesswoman Jacqueline Natla. Natla hires Lara to find a mysterious artefact known as the Scion in the tomb of Qualopec—a ruler of Atlantis—within the mountains of Peru.'),(285,'Tony Hawk\'s Pro Skater 2','tonyhawk\'sproskater2.png','tonyhawk\'sproskater2.png',10,NULL,'Street skateboarding game.'),(286,'Tony Hawk\'s Pro Skater','tonyhawk\'sproskater.jpg','tonyhawk\'sproskater.jpg',10,NULL,'Street skateboarding game.'),(287,'Triple Play 2001','tripleplay2001.jpg','tripleplay2001.jpg',10,NULL,'Pro baseball simulation game'),(288,'WCW Backstage Assault','wcwbackstageassault.png','wcwbackstageassault.jpeg',10,NULL,'Pro Wrestling simulation game.'),(289,'WCW Mayhem','wcwmayhem.png','wcwmayhem.jpg',10,NULL,'Pro Wrestling simulation game.'),(290,'WCW Nitro','wcwnitro.jpg','wcwnitro.jpg',10,NULL,'Pro Wrestling simulation game.'),(291,'WCW NWO Thunder','wcwnwothunder.png','wcwnwothunder.jpg',10,NULL,'Pro Wrestling simulation game.'),(292,'WCW vs.The World','wcwvs.theworld.jpg','wcwvs.theworld.jpg',10,NULL,'Pro Wrestling simulation game.'),(293,'Wild Arms','wildarms.jpg','wildarms.png',10,NULL,'In the world of Filgaia, a fantasy world modeled closely after medieval Europe, though the technology is comparable to that of the early Industrial Revolution, with advancements such as motors first coming into use. Destructive technology such as guns and firearms are seen as dangerous and therefore forbidden technology that is feared by the general populace.'),(294,'WWF Attitude','wwfattitude.jpg','wwfattitude.jpg',10,NULL,'Pro Wrestling simulation game.'),(295,'WWF In Your House','wwfinyourhouse.jpg','wwfinyourhouse.png',10,NULL,'Pro Wrestling simulation game.'),(296,'WWF Smackdown 2 Know Your Role','wwfsmackdown2knowyourrole.jpg','wwfsmackdown2knowyourrole.jpg',10,NULL,'Pro Wrestling simulation game.'),(297,'WWF Smackdown','wwfsmackdown.jpg','wwfsmackdown.jpg',10,NULL,'Pro Wrestling simulation game.'),(298,'WWF War Zone','wwfwarzone.jpg','wwfwarzone.jpg',10,NULL,'Pro Wrestling simulation game.'),(299,'Xenogears','xenogears.jpg','xenogears.jpg',10,NULL,'Takes place on Ignas, the largest continent and the site of a centuries-long war between the nations of Aveh and Kislev.A church-like organization known as the Ethos has excavated gears (giant robot suits) for the preservation of the world\'s culture.'),(300,'Arc The Lad Twilight Of The Spirits','arctheladtwilightofthespirits.jpg','arctheladtwilightofthespirits.jpg',11,NULL,'One thousand years after the events of Arc 3, the worlds featured in the original PS1 trilogy have evolved. However, racism between humans and a race of humanoid monsters named Deimos, have run rampant for centuries.'),(301,'Bully','bully.jpg','bully.jpg',11,NULL,'At Bullworth Academy, Jimmy Hopkins meets with principal Dr. Crabblesnitch, who urges him to \"keep his nose clean\".'),(302,'Buzz Junior Jungle Party','buzzjuniorjungleparty.jpg','buzzjuniorjungleparty.jpg',11,NULL,'Quiz show game.'),(303,'Buzz The Mega Quiz','buzzthemegaquiz.jpg','buzzthemegaquiz.jpg',11,NULL,'Quiz show game.'),(304,'Dance Dance Revolution Disney Channel Edition','dancedancerevolutiondisneychanneledition.jpg','dancedancerevolutiondisneychanneledition.jpg',11,NULL,'Dancing game, used with game pads'),(305,'Dark Cloud','darkcloud.jpg','darkcloud.jpg',11,NULL,'The game begins as Colonel Flag Gilgister of the Lagoon Empire Army of the East attempts to awaken the Dark Genie, a legendary evil creature, whom Flag wishes to use to control the world.'),(306,'Disney Sing It','disneysingit.jpg','disneysingit.jpg',11,NULL,'Singing game features Disney songs.'),(307,'Dragon Quest VIII Journey Of The Cursed King','dragonquestviiijourneyofthecursedking.jpg','dragonquestviiijourneyofthecursedking.jpg',11,NULL,'The game begins with the court jester of the kingdom of Trodain, Dhoulmagus, stealing an ancient scepter and casting a spell on Trodain castle. The spell turns the king, King Trode, into a troll; the princess, Medea, into a horse; and the rest of the castle\'s inhabitants into plants.'),(308,'Dynasty Warriors 2','dynastywarriors2.jpg','dynastywarriors2.jpeg',11,NULL,'Play through a number of levels representing particular conflicts in the time of the three kingdoms, eventually defeating both of the other kingdoms and becoming the ruler of a unified China.'),(309,'Ephemeral Fantasia','ephemeralfantasia.jpg','ephemeralfantasia.jpeg',11,NULL,'This game follows Mouse, who has been summoned by a powerful figure on a remote island to compose a song. Xelpherpolis invites Mouse to play at his wedding, no doubt because of his fame as an excellent musician.'),(310,'Fight Night 2004','fightnight2004.jpg','fightnight2004.jpeg',11,NULL,'Boxing simulation game'),(311,'Final Fantasy X 2','finalfantasyx2.jpg','finalfantasyx2.jpg',11,NULL,NULL),(312,'Final Fantasy XII','finalfantasyxii.jpg','finalfantasyxii.jpg',11,NULL,'In Dalmasca\'s capital city of Rabanastre, Princess Ashelia (Ashe) of Dalmasca and Prince Rasler of Nabradia have just wed, as the Archadian Empire invades the two countries. Rasler is killed in the war, the city of Nabudis is destroyed in a single explosion, and the Dalmascan King Raminas is assassinated moments after signing a treaty of surrender. Marquis Ondore announces that the assassin was Dalmascan captain Basch, who has been sentenced to death, and that Princess Ashe has committed suicide'),(313,'Final Fantasy X','finalfantasyxii.jpg','finalfantasyxii.jpg',11,NULL,'Tidus waits with his allies outside the ruins of an ancient city. He narrates the events that led to the present, spanning most of the game\'s storyline.It begins in his home city, the high-tech metropolis of Zanarkand, where he is a renowned blitzball player and son of the famous blitzball star, Jecht. During a blitzball tournament, the city is attacked by an immense creature that Auron, a man not originally from Zanarkand, calls \"Sin\".Sin destroys Zanarkand and takes Tidus and Auron to the worl'),(314,'Grand Theft Auto Vice City','grandtheftautovicecity.jpg','grandtheftautovicecity.jpg',11,NULL,'In 1986, Forelli mobster Tommy Vercetti is released from prison after serving a fifteen-year sentence for murder. His boss, Sonny Forelli, promotes him to a caporegime upon his release, and sends him to Vice City to oversee an important drug deal alongside crooked lawyer Ken Rosenberg, as part of plans to set up a drug trade for the Forellis in the south.'),(315,'Guitar Hero Aerosmith','guitarheroaerosmith.jpg','guitarheroaerosmith.png',11,NULL,'Guitar game featuring songs from Aerosmith.'),(316,'Guitar Hero Encore Rocks The 80s','guitarheroencorerocksthe80s.jpg','guitarheroencorerocksthe80s.jpg',11,NULL,'Guitar playing simulation game.'),(317,'Guitar Hero & Guitar Hero II Dual Pack','guitarhero&guitarheroiidualpack.jpg','guitarhero&guitarheroiidualpack.jpg',11,NULL,'Guitar playing simulation game.'),(318,'Guitar Hero III Legends of Rock','guitarheroiiilegendsofrock.jpg','guitarheroiiilegendsofrock.jpg',11,NULL,'Guitar playing simulation game.'),(319,'Harvest Moon Save The Homeland','harvestmoonsavethehomeland.jpg','harvestmoonsavethehomeland.jpg',11,NULL,'The player takes on the role of a 21-year-old man whose grandfather, Tony, recently died and left him his farm.'),(320,'Highschool Musical 3 Senior Year Dance','highschoolmusical3senioryeardance.jpg','highschoolmusical3senioryeardance.jpg',11,NULL,'Dancing game simulator based off Highschool Musical.'),(321,'Highschool Musical Sing It','highschoolmusicalsingit.jpg','highschoolmusicalsingit.jpg',11,NULL,'Singing game with Highschool Musical songs.'),(322,'Hotshots Golf 3','hotshotsgolf3.jpg','hotshotsgolf3.jpg',11,NULL,'Golf simulation game.'),(323,'Kingdom Hearts II','kingdomheartsii.jpg','kingdomheartsii.png',11,NULL,'Sora, Donald, and Goofy have been in suspended animation for the past year to regain their lost memories. Roxas, Sora\'s Nobody, is trapped in a virtual simulation of Twilight Town created by DiZ to merge him with his original self to restore Sora\'s power.'),(324,'Kingdom Hearts','kingdomheartsii.jpg','kingdomheartsii.png',11,NULL,'Kingdom Hearts follows Sora in his quest to find his friends and Court Wizard Donald and Captain Goofy as they set out to find the missing King Mickey.'),(325,'Legaia 2 Duel Saga','legaia2duelsaga.jpg','legaia2duelsaga.jpg',11,NULL,'The game follows a group of outcasts (Mystic) and natural spirits (Origin), siding to fight each other. They were created by the Source Forge, the world\'s creation in Demiurge Tower. When three magical stones are scattered, the creation is imbalanced for the apocalypse. The outcasts appeared in a crater near the town.'),(326,'Legends Of Wrestling','legendsofwrestling.jpg','legendsofwrestling.jpg',11,NULL,'Pro Wrestling simulation.'),(327,'Madden NFL 2002','maddennfl2002.png','maddennfl2002.png',11,NULL,'Pro football simulation game.'),(328,'Madden NFL 2005','maddennfl2005.png','maddennfl2005.png',11,NULL,'Pro football simulation game'),(329,'Metal Gear Solid 2 Sons Of Liberty','metalgearsolid2sonsofliberty.jpg','metalgearsolid2sonsofliberty.jpg',11,NULL,' Raiden is supported by his commanding officer, the Colonel, and Rosemary, his girlfriend. Allies formed on the mission include Lt. Junior Grade Iroquois Pliskin,a Navy SEAL of mysterious background.'),(330,'Metal Gear Solid 3 Snakeeater','metalgearsolid3snakeeater.jpg','metalgearsolid3snakeeater.jpg',11,NULL,'The protagonist of Snake Eater, Naked Snake (David Hayter/Akio ?tsuka), known as Big Boss in subsequent games, is a young former Green Beret assigned to the CIA unit FOX. During his mission, Snake is assisted by fellow FOX members over his radio.'),(331,'NCAA Football 06','ncaafootball06.jpg','ncaafootball06.jpg',11,NULL,'NCAA simulation football game.'),(332,'NCAA Football 2003','ncaafootball2003.jpg','ncaafootball2003.jpg',11,NULL,'College football simulation game.'),(333,'NCAA Football 2005','ncaafootball2005.jpg','ncaafootball2005.jpg',11,NULL,'College football simulation game'),(334,'Onimusha Warlords','onimushawarlords.png','onimushawarlords.jpg',11,NULL,'During the Battle of Okehazama, Samanosuke of the Akechi clan watches but is attacked by Imagawa Yoshimoto\'s men. Though Nobunaga Oda was victorious against Yoshimoto, he is fatally wounded and assumed dead.'),(335,'Prince Of Persia The Sands Of Time','princeofpersiathesandsoftime.jpg','princeofpersiathesandsoftime.jpg',11,NULL,'The story is set in Persia during the late 6th century BC, and begins with the Prince narrating to an unseen listener about his adventures.The Prince and the army of his father Shahraman are passing through India to visit the Sultan of Azad.'),(336,'Radiata Stories','radiatastories.jpg','radiatastories.jpg',11,NULL,'In Radiata, humans and fairy creatures live together in peace until the story progresses. Just about halfway through the game, the player must choose a side by either choosing the Human path or the Non-Human path'),(337,'Resident Evil 4','residentevil4.jpg','residentevil4.png',11,NULL,'In 2004, six years after the events of Resident Evil 2, former Raccoon City police officer turned U.S. government agent Leon S. Kennedy (Paul Mercier) is sent on a mission to rescue Ashley Graham (Carolyn Lawrence), the U.S. President\'s daughter, who has been kidnapped by a mysterious cult.'),(338,'Resident Evil Outbreak File 2','residenteviloutbreakfile2.jpg','residenteviloutbreakfile2.jpg',11,NULL,'A continuation of the events that occur in the original Outbreak.'),(339,'Resident Evil Outbreak','residenteviloutbreak.jpg','residenteviloutbreak.jpg',11,NULL,'The beginning of Outbreak is set a couple of days after the initial outbreak of the T-virus in Raccoon City, moments before the crisis further escalates into complete chaos. The game starts with the eight characters in J\'s Bar, who are unaware of what is happening until a lone zombie wanders into the bar and attacks one of the employees named Will.'),(340,'Rockband ','rockband.jpg','rockband.jpg',11,NULL,'Band simulation game.'),(341,'Rockband Trackpack Volume 1','rockbandtrackpackvolume1.jpg','rockbandtrackpackvolume1.jpg',11,NULL,'Band simulation game.'),(342,'Romance Of The Three Kingdoms X','romanceofthethreekingdomsx.jpg','romanceofthethreekingdomsx.jpg',11,NULL,'Re-unify China. The player takes on the role of a historical figure from the novel Romance of the Three Kingdoms.'),(343,'Scooby Doo Night Of 1000 Frights','scoobydoonightof1000frights.png','scoobydoonightof1000frights.jpg',11,NULL,'Daphne\'s close friend, Holly Graham, has asked the Mystery Inc. crew to help her investigate the disappearance of her uncle, Professor Alexander Graham, a genius and inventor. The five arrive at the mansion.'),(344,'Singstar Legend s','singstarlegends.jpg','singstarlegends.jpg',11,NULL,'Singing simulation game.'),(345,'Singstar Pop','singstarpop.jpg','singstarpop.jpg',11,NULL,'Singing simulation game.'),(346,'Singstar Pop Vol 2','singstarpopvol2.jpg','singstarpopvol2.jpg',11,NULL,'Singing simulation game.'),(347,'Splinter Cell Doubleagent','splintercelldoubleagent.jpg','splintercelldoubleagent.jpg',11,NULL,'Before the events of Splinter Cell: Essentials, Sam Fisher must deal with the recent loss of his daughter to a drunk driving accident. But he has little time to mourn.'),(348,'Splinter Cell','splintercell.jpg','splintercell.jpg',11,NULL,'In April 2004, the president of Georgia is assassinated, allowing Georgian billionaire Kombayn Nikoladze to seize power with a bloodless coup d\'état. In August 2004, former U.S. Navy SEAL officer and Gulf War veteran Sam Fisher is recruited by the National Security Agency to work within its newly formed division, \"Third Echelon\".'),(349,'Splinter Cell Pandora Tomorrow','splintercellpandoratomorrow.jpg','splintercellpandoratomorrow.jpg',11,NULL,'In March 2006, the United States has established a military presence in the newly-independent country of East Timor to train the East Timorese military in their fight against anti-separatist Indonesian guerrilla militias.'),(350,'SSX 3','ssx3.png','ssx3.png',11,NULL,'Snowboarding game.'),(351,'SSX','ssx.jpg','ssx.jpg',11,NULL,'Snowboarding game.'),(352,'SSX Tricky','ssxtricky.jpg','ssxtricky.jpg',11,NULL,'Snowboarding game.'),(353,'StarOcean till The End Of Time','staroceantilltheendoftime.jpg','staroceantilltheendoftime.jpg',11,NULL,'On the planet Hyda IV where a young man, Fayt Leingod, and his childhood friend, Sophia Esteed, are on vacation with Fayt\'s family. Fayt is the son of Robert Leingod, a famous scientist in the field of symbological genetics. For an unknown reason, the Vendeeni — an alien civilization with highly advanced technology that spans only a single planet — attacks Hyda IV.'),(354,'Suikoden III','suikodeniii.jpg','suikodeniii.jpg',11,NULL,'Set in IS 475, roughly 16 in-game years after the events of Suikoden II. The game takes place in the diverse Grasslands region, an area to the northwest of Dunan from Suikoden II (which itself was to the north of the Toran area from Suikoden). Politically, the Grasslands are mostly controlled by the Six Clans, a loose coalition between the Karaya, Lizard, Duck, Chisha, Safir and Alma Kinan clans.'),(355,'Suikoden IV','suikodeniv.jpg','suikodeniv.jpg',11,NULL,'Hero and his best friend Snowe Vingerhut face off against their Commander and Vice Commander, Glen and Katarina respectively, out at sea. After the training concludes, the Hero and his fellow knight trainees head home to Razril, where they are to be pronounced full-fledged Gaien knights.'),(356,'Tales Of The Abyss','talesoftheabyss.jpg','talesoftheabyss.jpg',11,NULL,'Luke fon Fabre is a teenager who has been held in his manor for years by his uncle, the King of Kimlasca-Lanvaldear, after being kidnapped and started suffering amnesia.'),(357,'The Bouncer','thebouncer.jpg','thebouncer.jpg',11,NULL,'The game begins with a news report on Mikado\'s new solar powered generator satellite, which uses a large mirror to generate electricity from solar rays.'),(358,'The Godfather','thegodfather.jpg','thegodfather.jpg',11,NULL,'Based on the movie The Godfather'),(359,'The Suffering Ties That Bind','thesufferingtiesthatbind.jpg','thesufferingtiesthatbind.jpg',11,NULL,'The game begins five years prior to the original, with Torque serving time in Eastern Baltimore Correctional.Having been served divorce papers by Carmen, he is playing chess with his friend Miles, who believes their incarceration was orchestrated by a criminal named Blackmore.'),(360,'The Warriors','thewarriors.jpg','thewarriors.jpg',11,NULL,'The gang have to make it back to their home turn on Coney Island.'),(361,'Valkyrie Profile 2 Silmeria','valkyrieprofile2silmeria.jpg','valkyrieprofile2silmeria.jpg',11,NULL,'Silmeria and Alicia, who are contained in the same body. Silmeria is one of the valkyries tasked with collecting the souls of brave warriors and delivering them to Valhalla. After she disobeyed Odin, he reincarnated her in the body of Alicia, the Princess of Dipan.'),(362,'Yakuza 2','yakuza2.jpg','yakuza2.jpg',11,NULL,'In 2006, Kazuma Kiryu has left his post as the Chairman of the Tojo Clan, Japan\'s most violent crime syndicate. When an all-out war erupts, Kiryu must return and uphold the honor of his former clan, with brutal clashes with rival gangs, the police, and the Korean mafia through the back alleys and neon-lit nightclubs of Tokyo and Osaka.'),(363,'Yakuza','yakuza.jpg','yakuza.jpg',11,NULL,'Follow the story of Kazuma Kiryu, a yakuza whose life changes when his boss, Sohei Dojima, attempts to rape Kiryu\'s childhood friend, Yumi Sawamura.When Dojima is murdered by Kiryu\'s best friend and fellow yakuza.'),(364,'Army Of Two','armyoftwo.jpg','armyoftwo.jpg',12,NULL,'In 1993 Somalia Elliot Salem and Tyson Rios are in the U.S. Army\'s 75th Ranger Regiment. They are tasked to work with Phillip Clyde, a private military contractor with the Security and Strategy Corporation (SSC), tasked with carrying out the assassination of powerful local warlord Abdullahi Mo\'Alim.'),(365,'Army Of Two The 40th Day','armyoftwothe40thday.jpg','armyoftwothe40thday.jpg',12,NULL,'The story finds Tyson Rios and Elliot Salem as self-employed private contractors, who, along with Alice Murray run Trans World Operations (TWO),'),(366,'Assassin\'s Creed Brotherhood','assassin\'screedbrotherhood.jpg','assassin\'screedbrotherhood.jpg',12,NULL,'Desmond and his allies retreat to the ruins of the Monteriggioni villa, and Desmond reenters the Animus to continue Ezio\'s memories, specifically to identify the location of the Apple. After facing Rodrigo Borgia, Ezio returned to Monteriggioni, but the villa is soon attacked by forces under the command of Cesare Borgia, Rodrigo\'s son.'),(367,'Assassin\'s Creed III','assassin\'screediii.jpg','assassin\'screediii.jpg',12,NULL,'Desmond suddenly falls into a fugue state, and is put into the Animus.In the Animus, he experiences the memories of Haytham Kenway, a British Templar agent, who had gone to the American Colonies with a stolen medallion and recruit Templar allies such as Charles Lee. He gained the Mohawk people\'s trust to find the Temple the medallion'),(368,'Assassin\'s Creed II','assassin\'screedii.jpg','assassin\'screedii.jpg',12,NULL,'Lucy returns and breaks Desmond out of Abstergo, taking him to an Assassin safehouse to work alongside Shaun, a historian, and Rebecca, their technical support. Using an improved version of the Animus, Desmond takes witness to Ezio Auditore da Firenze, a young nobleman from the late 15th century in Florence.'),(369,'Assassin\'s Creed','assassin\'screedrevelations.jpg','assassin\'screedrevelations.jpg',12,NULL,'Desmond Miles is captured by Abstergo and forced to use a machine called the Animus to explore Altaïr ibn-La\'Ahad\'s memories during the time of the Third Crusade.'),(370,'Assassin\'s Creed Revelations','assassin\'screedrevelations.jpg','assassin\'screedrevelations.jpg',12,NULL,'Within the computerized \"core\" of the Animus, Subject 16 explains to a comatose Desmond that his mind must achieve full synchronization with Altaïr and Ezio, or he will fall into dementia. Desmond sees Ezio\'s memories, years after Brotherhood, Ezio researches the Assassins\' history and travels to Masyaf to locate Altaïr\'s library.'),(371,'Assassin\'s Creed The Americas Collection','assassin\'screedtheamericascollection.jpg','assassin\'screedtheamericascollection.jpg',12,NULL,'Assassin\'s Creed: Liberation HD takes place in New Orleans during slavery. Assassin\'s Creed IV: Black Flag pirates ships.'),(372,'Batman Arkham Asylum','batmanarkhamasylum.jpg','batmanarkhamasylum.png',12,NULL,'Batman is trying to stop his archenemy, the Joker, who instigates an elaborate plot to seize control of Arkham Asylum and trap Batman inside with many of his incarcerated foes.'),(373,'Batman Arkham City','batmanarkhamcity.jpg','batmanarkhamcity.jpg',12,NULL,'Set one year after the events of Arkham Asylum.Batman is incarcerated within Arkham City, a massive new super-prison established by Quincy Sharp, the now mayor of Gotham City.'),(374,'Batman Arkham Origins','batmanarkhamorigins.jpg','batmanarkhamorigins.jpg',12,NULL,'A prequel set 5 years before the events in Arkham Asylum. The story follows a younger, less refined, and less experienced Batman, who has a bounty placed on his head by Black Mask, drawing eight of the world\'s deadliest assassins to Gotham City on Christmas Eve while he also encounters Joker for the first time.'),(375,'Beyond Two Souls','beyondtwosouls.jpg','beyondtwosouls.png',12,NULL,'Young Jodie Holmes (Caroline Wolfson) lives with her foster parents in a suburban home. Since birth, Jodie has had a psychic connection with a mysterious entity named Aiden, with whom she can communicate and perform telepathic acts, such as possessing people\'s minds and manipulating certain objects.'),(376,'Dante\'s Inferno','dante\'sinferno.jpg','dante\'sinferno.jpg',12,NULL,'The story follows Dante, a Templar knight from the Crusade who (despite his faith) has committed numerous atrocities during the Third Crusade. At the city of Acre, Dante is entrusted to keep a group of Saracen prisoners safe so King Richard I could obtain a holy relic from Saladin. But once he brutally slaughters them, Dante is ordered to take the holy relic.'),(377,'Darksiders 2','darksiders2.jpg','darksiders2.jpg',12,NULL,'Death wakes up in the Forge Lands, a world populated by the Makers—physically imposing beings who are the Architects of Creation.'),(378,'Darksiders','darksiders.jpg','darksiders.jpg',12,NULL,'In the present day, War arrives on Earth where the End War appears to have begun; armies of angels and demons wage war with mankind caught in the middle. Confronting Abaddon, the General of Heaven\'s army, War discovers that the other Horsemen have not arrived and the Seventh Seal, meant to summon the Four Horsemen, has not been broken.'),(379,'Dead Rising 2','deadrising2.jpg','deadrising2.jpg',12,NULL,'Former motocross champion Chuck Greene is in casino town of Fortune City, Nevada, to take part in Terror is Reality, a controversial sports entertainment game show where contestants kill zombies for money and fame. Chuck needs the prize money to buy Zombrex for his daughter Katey.'),(380,'Devil May Cry HD Collection','devilmaycryhdcollection.jpg','devilmaycryhdcollection.jpg',12,NULL,'Devil May Cry 1,2 and 3.The series centers on the monster hunter Dante and his efforts to avenge his mother\'s murder.'),(381,'Dragon Age Awakening','dragonageawakening.jpg','dragonageawakening.jpg',12,NULL,'Set six months after the events of Dragon Age: Origins in the land of Amaranthine, Dragon Age: Origins - Awakening places the player in the role of a Grey Warden trying to rebuild the order while also dealing with political matters as the Arl of Amaranthine.'),(382,'Dragon Age Origins','dragonageorigins.png','dragonageorigins.jpg',12,NULL,'An epic tale of violence, lust, and betrayal. The survival of humanity rests in the hands of those chosen by fate. You are a Grey Warden, one of the last of an ancient order of guardians who have defended the lands throughout the centuries.'),(383,'EA Sports MMA','easportsmma.png','easportsmma.jpg',12,NULL,'Mixed Martial Arts fighing simulation game.'),(384,'Eternal Sonata','eternalsonata.jpg','eternalsonata.jpg',12,NULL,'Frederic Chopin and a diverse cast of valiant adventurers.'),(385,'Final Fantasy XIII 2','finalfantasyxiii2.jpg','finalfantasyxiii2.jpg',12,NULL,NULL),(386,'Final Fantasy XIII','finalfantasyxiii.jpg','finalfantasyxiii.png',12,NULL,'In Cocoon, the citizens of the town of Bodhum are being evicted, or Purged, after coming in contact with something from Pulse.['),(387,'Final Fantasy XIII Lightning Returns','finalfantasyxiiilightningreturns.png','finalfantasyxiiilightningreturns.jpg',12,NULL,'Lightning is awoken from crystal stasis by the god Bhunivelze. The world is set to end in 13 days, and to this end Lightning is made the Savior, a figure who will free the souls of humanity from the burdens on their hearts and guide them to a new world that Bhunivelze will create once the 13 days are up.'),(388,'Ghost Recon Future Soldier','ghostreconfuturesoldier.jpg','ghostreconfuturesoldier.jpg',12,NULL,'In the year 2024 with a four-Man Ghost Recon team call-signed Predator, led by Joe Ramirez, deployed in Nicaragua to disrupt weapons trafficking in the region.'),(389,'God Of War Ascension','godofwarascension.jpg','godofwarascension.jpg',12,NULL,'Kratos, who is imprisoned, chained, and tormented by the Furies for breaking his blood oath to Ares. The Fury Megaera tortures Kratos, but he manages to break free.'),(390,'God Of War Collection','godofwarcollection.jpg','godofwarcollection.jpg',12,NULL,'God of War Kratos waged war at the behest of Ares, eventually leading an attack on a village occupied by worshipers of Athena.<br/>God of War 2 Kratos, the new God of War, is still haunted by nightmares of his past and is shunned by the other gods for his destructive ways. Ignoring Athena\'s warnings, Kratos joins the Spartan army in an attack on Rhodes, during which a giant eagle suddenly drains a huge chunk of his powers and animates the Colossus of Rhodes.'),(391,'God Of War III','godofwariii.jpg','godofwariii.jpg',12,NULL,'Kratos, Gaia, and the other Titans ascend Mount Olympus to destroy the Olympian gods. Poseidon launches an assault against the Titans, but is killed by Kratos and Gaia; his death causes the oceans to flood Greece.'),(392,'God Of War Origins Collection','godofwaroriginscollection.jpg','godofwaroriginscollection.jpg',12,NULL,'Chains of Olympus During Kratos\' ten years of service to the Olympian Gods, he is sent to the city of Attica to help defend it from the invading Persian army.<br/>Ghost of Sparta Kratos has taken Ares\' place as the new God of War on Mount Olympus. Still haunted by visions of his mortal past, Kratos decides against Athena\'s advice to explore his past and travels to the Temple of Poseidon, located within the city of Atlantis.'),(393,'Grand Theft Auto IV','grandtheftautoiv.jpg','grandtheftautoiv.jpg',12,NULL,'Niko Bellic, an Eastern European,arrives in Liberty City aboard a cargo ship, the Platypus, to reunite with his cousin Roman, pursue the American Dream, and search for the man who betrayed his unit in a war fifteen years prior.'),(394,'Guitar Hero World Tour','guitarheroworldtour.jpg','guitarheroworldtour.png',12,NULL,'Music simulation game, guitar, drums, singing and base guitar.'),(395,'Heavy Rain','heavyrain.jpg','heavyrain.png',12,NULL,'The day after celebrating his son Jason\'s tenth birthday, Ethan Mars and his family go shopping. Jason and Ethan are hit by a car; Jason dies, and Ethan falls into a six-month coma.'),(396,'Hitman Absolution','hitmanabsolution.jpg','hitmanabsolution.jpg',12,NULL,'Agent 47 detailing his relationship with his handler Diana Burnwood, whom he had trusted until she, without explanation, betrayed the International Contract Agency (ICA) by sabotaging their funding and database, using the subsequent confusion to vanish.'),(397,'John Woo Presents Stranglehold','johnwoopresentsstranglehold.jpg','johnwoopresentsstranglehold.jpg',12,NULL,'In latter-day Hong Kong, a policeman goes missing. The department is dumbfounded by the disappearance until they receive a ransom call from an unnamed source.'),(398,'L.A. Noire','l.a.noire.jpg','l.a.noire.jpg',12,NULL,'Following the end of World War II, Cole Phelps, a decorated USMC veteran of the Pacific campaign, returns to Los Angeles, California, to live with his family while taking on work as a Patrol Officer of the LAPD. After successfully solving a major murder case in 1947 and being promoted to detective, Phelps earns a reputation over the next six months for solving difficult cases for both Traffic and Homicide.'),(399,'Little Big Planet 2','littlebigplanet2.jpg','littlebigplanet2.jpg',12,NULL,'The game takes place when an antagonist known as the Negativitron invades LittleBigPlanet and begins to suck up all its inhabitants. Sackboy must team up with a secret organisation known as \"The Alliance\".'),(400,'Little Big Planet','littlebigplanet.png','littlebigplanet.jpg',12,NULL,'Sackboy as he travels around LittleBigPlanet, helping the eight creator curators of LittleBigPlanet with their problems in their own respective realms as he tries to stop The Collector, one of the eight creator curators who has gone rogue, kidnapping the creations of LittleBigPlanet.'),(401,'Mafia II','mafiaii.jpg','mafiaii.jpg',12,NULL,'In 1943, Sicilian immigrant Vito Scaletta is arrested during a robbery and opts to join the U.S. Army to avoid jail. After spending two years as a paratrooper on various World War II allied operations, Vito is given leave in 1945 to return home to Empire Bay.'),(402,'Metal Gear Solid 4 Guns Of The Patriots','metalgearsolid4gunsofthepatriots.jpg','metalgearsolid4gunsofthepatriots.jpg',12,NULL,'Shortly after learning of his year-long lifespan from symptoms similar to Werner syndrome, Snake is asked by Campbell, now working with the UNSC, to assassinate Liquid Ocelot and stop his insurrection. Snake travels to the Middle East.'),(403,'Mortal Kombat','mortalkombat.png','mortalkombat.png',12,NULL,'Following the end of the Armageddon war, all warriors from the realms have been killed, leaving only Raiden and Outworld emperor Shao Kahn remaining. Before being killed by the emperor, Raiden uses one last spell to send a message to his past self through his shattered amulet, with the vague message \"He must win.\"'),(404,'NBA 2k11','nba2k11.jpg','nba2k11.jpg',12,NULL,'Basketball simulation game.'),(405,'NCAA Football 14','ncaafootball14.jpg','ncaafootball14.jpg',12,NULL,'College football simulation game'),(406,'Ni no Kuni Wrath Of The White Witch','ninokuniwrathofthewhitewitch.jpg','ninokuniwrathofthewhitewitch.jpg',12,NULL,'Oliver, a resident of Motorville. While trying out a new vehicle designed by his friend Philip, Oliver almost drowns, but is saved by his mother Allie; however, she immediately dies from heart problems after saving him. As Oliver cries, his tears cause his doll, a gift from his mother, to come to life and reveal itself as a fairy named Drippy, who tells Oliver that he is from another world where an evil wizard named Shadar took control.'),(407,'Red Dead Redemption','reddeadredemption.jpg','reddeadredemption.jpg',12,NULL,'The game begins in 1911, where former outlaw John Marston is taken from his family by Bureau of Investigation agents Edgar Ross and his partner, Archer Fordham, and will only be granted amnesty when he brings the remaining members of his old gang to justice.'),(408,'Red Dead Redemption Undead Nightmare','reddeadredemptionundeadnightmare.jpg','reddeadredemptionundeadnightmare.jpg',12,NULL,'One night at Beecher\'s Hope, a storm is raging and Uncle has not returned. Later he comes back zombified and bites Abigail, who then bites Jack. John kills Uncle and ties up the infected Abigail and Jack. He finds that a virus has spread across the world, causing the dead to reanimate.'),(409,'Resident Evil 5','residentevil5.jpg','residentevil5.jpg',12,NULL,'In 2009,five years after the events of Resident Evil 4, Chris Redfield, a member of the fictional Bioterrorism Security Assessment Alliance (BSAA), is dispatched to Kijuju in Africa. He and his new partner Sheva Alomar are tasked with apprehending Ricardo Irving before he can sell a bio-organic weapon (BOW) on the black market.'),(410,'Resonance Of Fate','resonanceoffate.jpg','resonanceoffate.jpg',12,NULL,'Vashyron doing battle with a berserk Zephyr. Despite Zephyr being shot twice in the head, he does not die. Vashyron decides to take him in as a partner in his Hunter group.'),(411,'Rune Factory Tides Of Destiny','runefactorytidesofdestiny.jpg','runefactorytidesofdestiny.jpg',12,NULL,'The male side named Aden and the female side named Sonja, as they traverse the seas on a giant beast named Ymir. The beast can raise sunken islands and ships from the sea.'),(412,'Sleeping Dogs','sleepingdogs.jpg','sleepingdogs.jpg',12,NULL,'Wei Shen is arrested in Victoria Harbor, after a drug deal goes wrong. In jail, Shen meets an old friend, Jackie Ma, who offers to introduce Shen to the members of a Triad gang once they are released.'),(413,'Sniper Elite V2 Silver Star Edition','sniperelitev2silverstaredition.jpg','sniperelitev2silverstaredition.png',12,NULL,'Lieutenant Karl Fairburne, an American OSS officer and skilled sniper who is inserted into Berlin in 1945, during the final days of World War II.'),(414,'Star Ocean The Last Hope International','staroceanthelasthopeinternational.jpg','staroceanthelasthopeinternational.jpg',12,NULL,'The world is on the brink of destruction. In A.D. 2064, World War III broke out after several clashes between the World Republic Federation, the ruling government body on Earth, and its enemies around the world.'),(415,'Tales Of Xillia','talesofxillia.png','talesofxillia.png',12,NULL,'Two millennia ago, humans developed spyrix, a power source which absorbs spirits to supply power. In response, the spirit Maxwell gathered humans, who share a symbiotic relationship with spirits, onto an isolated land protected by a barrier; the isolated land became known as Rieze Maxia and the outer lands as Elympios.'),(416,'The Last Of Us','thelastofus.jpg','thelastofus.jpg',12,NULL,'In September 2013, an outbreak of a mutant Cordyceps fungus ravages the United States, transforming its human hosts into aggressive creatures known as the Infected. In the suburbs of Austin, Texas, Joel flees the chaos with his brother Tommy and daughter Sarah. As they flee, Sarah is shot by a soldier and dies in Joel\'s arms.'),(417,'The Last Of Us Left Behind','thelastofusleftbehind.jpg','thelastofusleftbehind.jpg',12,NULL,'In the aftermath of a fight that leaves Joel severely injured, Ellie searches an abandoned mall for supplies to heal him. She discovers a medical kit in a derelict military helicopter. Making her way back to Joel, Ellie is impeded by the Infected and members of a hostile human group.'),(418,'The Saboteur','thesaboteur.jpg','thesaboteur.png',12,NULL,'The game is set in 1940, and its protagonist, Sean Devlin, is a hard drinking Irish racecar mechanic, a regular among the racing groups of Paris. He arrives in Saarbrücken, along with his mentor Vittore Morini, best friend Jules Rousseau and Jules\' sister Veronique.'),(419,'The Walking Dead. Plus 400 Days','thewalkingdead.plus400days.jpg','thewalkingdead.plus400days.jpg',12,NULL,'Lee is being taken to prison when the police cruiser he is in crashes off-road after hitting a walker. He escapes, and while taking shelter in a suburban home, meets Clementine, whose parents had travelled to Savannah.'),(420,'Tomb Raider','tombraider.jpg','tombraider.jpg',12,NULL,'The island—and the kingdom that once existed there—is shrouded in mystery, given its reputation for fearsome storms and shipwrecks that litter its coastline. Yamatai was once ruled by a queen named Himiko, known by her honorific title of \"Sun Queen\".'),(421,'Uncharted 2 Among Thieves','uncharted2amongthieves.jpg','uncharted2amongthieves.jpg',12,NULL,'Explorer Nathan Drake is approached by his former associate Harry Flynn and Flynn\'s girlfriend Chloe Frazer to help steal a Mongolian oil lamp connected to Marco Polo\'s doomed 1292 voyage from China.'),(422,'Uncharted 3 Drake\'s Deception','uncharted3drake\'sdeception.jpg','uncharted3drake\'sdeception.jpg',12,NULL,'Two years after the events of previous game, Nathan Drake and Victor \"Sully\" Sullivan enter a pub in London to meet a man named Talbot, who is interested in purchasing Nate\'s ring belonging to his ancestor Sir Francis Drake.'),(423,'Uncharted Drake\'s Fortune','uncharteddrake\'sfortune.jpg','uncharteddrake\'sfortune.jpg',12,NULL,'Nathan \"Nate\" Drake, accompanied by reporter Elena Fisher, recovers the coffin of his self-proclaimed ancestor Sir Francis Drake, which he located from coordinates inscribed on a family heirloom: a ring Nate wears around his neck.'),(424,'Valkyria Chronicles','valkyriachronicles.jpg','valkyriachronicles.jpg',12,NULL,' It takes place in Europa, a fictional continent based on Europe, during the beginning of World War II. Because of its abundance of Ragnite ore, which takes the place of petroleum in the game setting, the neutral nation of Gallia comes under attack from the East Europan Imperial Alliance.'),(425,'White Knight Chronicles II','whiteknightchroniclesii.png','whiteknightchroniclesii.jpg',12,NULL,'In Faria, where the Farian general Scardigne is trying to get the Farian Princess Miu out of the city safely due to a civil war led by Ban Nanazel. They manage to escape the city but are pursued. The game then cuts to where Princess Cisna has summoned Leonard, Eldore and Yulie, she tells them that they need to go to Faria and speak with a mystic known as Father Yggdra.'),(426,'Assassin\'s Creed Origins','assassin\'screedorigins.png','assassin\'screedorigins.jpg',13,NULL,'In 49 BCE, Bayek, a Medjay charged with protecting the Siwa Oasis, is abducted along with his son Khemu by a group of masked men and taken to an underground vault in the Temple of Amun. The masked men give Bayek a dormant Apple of Eden and demand that he use it to open a secret vault.'),(427,'Batman Arkham Knight','batmanarkhamknight.jpg','batmanarkhamknight.jpg',13,NULL,'Set nine months after the events of Arkham City. In uptown Gotham, with three islands being the primary location of the game, known as Bleake Island, Miagani Island, and Founders\' Island.'),(428,'Brothers A Tale Of Two Sons','brothersataleoftwosons.jpg','brothersataleoftwosons.jpg',13,NULL,'The story begins with a boy named Naiee paying his respects at the tombstone of his dead mother, who drowned at sea while he remained unable to save her. His elder brother, Naia, calls him to help their ill father reach the village\'s doctor, who in turn tells them the only way to save him is by collecting the waters from the Tree of Life.'),(429,'Days Gone','daysgone.jpg','daysgone.jpg',13,NULL,'When a virus causes a large portion of humanity to become uncontrollably violent, Deacon, his wife Sarah, and his friend Boozer (Jim Pirri) attempt to flee for safety and escape the carnage.'),(430,'Detroit Become Human','detroitbecomehuman.jpg','detroitbecomehuman.png',13,NULL,'The plot follows three androids: Kara, who escapes the owner she was serving to explore her newfound sentience and protect a young girl; Connor , whose job is to hunt down sentient androids; and Markus, who devotes himself to releasing other androids from servitude.'),(431,'Dragon Quest Heroes The Worldtree\'s and The Blight Below','dragonquestheroestheworldtree\'sandtheblightbelow.jpg','dragonquestheroestheworldtree\'sandtheblightbelow.jpg',13,NULL,'The game is set in the Kingdom of Arba, where mankind and monsters live peacefully. One day, monsters began to attack mankind suddenly leading the captains of the Royal Guard, Luceus and Aurora, to recover the hearts of monsters.'),(432,'Final Fantasy Type-0 HD Day One Edition','finalfantasytype-0hddayoneedition.jpg','finalfantasytype-0hddayoneedition.png',13,NULL,'Marshal Cid Aulstyne leads the army of Milites against the other nations of Orience, launching a devastating attack against the Vermillion Peristylium and neutralising the Vermillion Bird Crystal using a crystal jammer. Class Zero, immune to the effects of the jammer, repel the invasion.'),(433,'Final Fantasy XV Royal Edition','finalfantasyxvroyaledition.jpg','finalfantasyxvroyaledition.jpg',13,NULL,'Noctis and his three friends begin their journey to Altissia, the capital of Accordo, where Noctis\'s wedding to Lunafreya will take place. Finding the local boat services stopped, they receive news of Niflheim\'s attack on the city of Insomnia and theft of the Crystal; the Lucian King Regis has been assassinated, and both Noctis and Lunafreya are declared dead.'),(434,'Final Fantasy X|X-2 HD Remaster','finalfantasyx|x-2hdremaster.png','finalfantasyx|x-2hdremaster.jpg',13,NULL,'HD Remasters of FF X and FF X-2'),(435,'God Of War','godofwar.jpg','godofwar.jpg',13,NULL,'Many years after Kratos\' defeat of the Olympian gods, he now lives with his son Atreus in ancient Norway in the realm of Midgard.'),(436,'Hellblade Senua\'s Sacrifice','hellbladesenua\'ssacrifice.jpg','hellbladesenua\'ssacrifice.jpg',13,NULL,'Set in the late 8th century, the game starts with Senua, a Pict warrior from Orkney arriving at the border of Helheim in a quest to save the soul of her dead lover, Dillion, from the goddess Hela'),(437,'Horizon Zero Dawn Complete Edition','horizonzerodawncompleteedition.jpg','horizonzerodawncompleteedition.jpg',13,NULL,'Aloy was cast out from the Nora tribe at birth and raised by an outcast named Rost. As a child, she obtained a Focus, a small augmented reality device that gives her special perceptive abilities. After coming of age, Aloy enters a competition called the Proving to win the right to become a Nora Brave.'),(438,'Mafia III','mafiaiii.jpg','mafiaiii.png',13,NULL,'In 1968, Vietnam War veteran Lincoln Clay returns home to his old neighbourhood in New Bordeaux. Upon his return, he reunites with his friends and family, including his surrogate father and Black mob leader Sammy Robinson, his adopted brother Ellis, and priest Father James Ballard.'),(439,'Metal Gear Solid v The Phantom Pain','metalgearsolidvthephantompain.png','metalgearsolidvthephantompain.jpg',13,NULL,'In 1984, nine years after the events of Metal Gear Solid V: Ground Zeroes, Big Boss awakens from a coma in a hospital in Cyprus. Quiet, a Cipher assassin, tries to kill him.'),(440,'Monster Hunter World','monsterhunterworld.jpg','monsterhunterworld.jpg',13,NULL,'The player controls a hunter that they can name, supported by an assistant handler, and a palico who are a part of the Fifth Fleet which has been summoned by the Research Commission to provide more support to the New World.'),(441,'Rise Of The Tomb Raider 20 Year Celebration','riseofthetombraider20yearcelebration.jpg','riseofthetombraider20yearcelebration.jpg',13,NULL,'One year after the events of Tomb Raider, archaeologist Lara Croft is struggling to explain her experience of the supernatural on Yamatai and is experiencing posttraumatic stress disorder. Looking for answers, she turns to her late father\'s research on the lost city of Kitezh and the promise of immortality.'),(442,'Shadow Of Mordor Game Of The Year Edition','shadowofmordorgameoftheyearedition.jpg','shadowofmordorgameoftheyearedition.jpg',13,NULL,'Talion, a captain of Gondor, serves within a garrison stationed at the Black Gate of Mordor. The garrison is attacked by Sauron\'s Orc forces led by three Black Númenórean captains: the Hammer of Sauron , the Tower of Sauron, and their leader, the Black Hand of Sauron.'),(443,'The Division','thedivision.jpg','thedivision.jpg',13,NULL,'On Black Friday 2015, a viral epidemic, transmitted by a virus planted on banknotes, sweeps through New York City. The disease, known as \"The Dollar Flu\", causes widespread chaos, and major cities are placed under quarantine. The U.S. Government activates sleeper agents in the population who operate for the Strategic Homeland Division, or simply \"the Division\", to assist emergency responders and National Guardsmen, and the Joint Task Force (JTF), in restoring order.'),(444,'The Last Of Us Remastered','thelastofusremastered.jpg','thelastofusremastered.jpg',13,NULL,'In September 2013, an outbreak of a mutant Cordyceps fungus ravages the United States, transforming its human hosts into aggressive creatures known as the Infected. In the suburbs of Austin, Texas, Joel flees the chaos with his brother Tommy and daughter Sarah. As they flee, Sarah is shot by a soldier and dies in Joel\'s arms.'),(445,'The Order 1886','theorder1886.png','theorder1886.jpg',13,NULL,'During the autumn of 1886 London is plagued by both attacks by half-breeds and an anti-government insurgency. After fighting off rebels in Mayfair, Sir Galahad pursues the survivors into the Underground where he encounters a number of werewolf-like half-breeds known as Lycans. Galahad\'s mentor, Sir Percival, one of the Order\'s most veteran knights.'),(446,'The Witcher III Wild Hunt','thewitcheriiiwildhunt.jpg','thewitcheriiiwildhunt.png',13,NULL,'Geralt rejoins his long-lost lover, Yennefer, in the town of White Orchard. Yennefer tells him that Emperor Emhyr has summoned him to the city of Vizima. Emhyr tasks Geralt with finding Ciri, who has recently been seen in several places.'),(447,'Uncharted 4 a Thief\'s End','uncharted4athief\'send.jpg','uncharted4athief\'send.jpg',13,NULL,'Fifteen years later, Nate has retired with his wife Elena but misses the excitement of his old life. He is visited by Sam, who survived his injuries and has spent the intervening time incarcerated. He explains that he escaped with drug lord Hector Alcazar, who has demanded that Sam find Avery\'s treasure or be killed.'),(448,'Valkyria Chronicles 4','valkyriachronicles4.png','valkyriachronicles4.jpg',13,NULL,'While taking place during the events of the first and third game, Valkyria Chronicles 4 focuses not on the Gallian forces but those of the Atlantic Federation, the other major superpower during the events of the war, that enacts a bold plan to strike at the Imperial Capital.'),(449,'Vampyr','vampyr.jpg','vampyr.jpg',13,NULL,'Doctor Jonathan Reid, returning to London from the Great War in 1918, awakes in a mass grave as a vampire. Overwhelmed with bloodlust, he causes the death of his sister Mary, who was searching for his body nearby.'),(450,'Watch Dogs','watchdogs.jpg','watchdogs.png',13,NULL,'In October 2012, hacker Aiden Pearce and his mentor and partner, Damien Brenks, conduct an electronic bank heist at the high-end Merlaut Hotel in Chicago and trigger a silent alarm set by another hacker. Brenks tries to find the hacker, giving himself and Pearce away. Fearing for his family, Pearce drives them to safety in the guise of a surprise trip to the country. On the way, hitman Maurice Vega fires a gunshot which crashes the car; Pearce\'s niece Lena lapses into a coma and dies.'),(451,'World Of Final Fantasy','worldoffinalfantasy.jpg','worldoffinalfantasy.jpg',13,NULL,'In the world of Nine Wood Hills, Lann and Reynn meet the enigmatic Enna Kros, who reveals they are former Mirage Keepers stripped of their mirages and memories. She opens a portal to the world of Grymoire, where the twins begin recovering their mirages.'),(452,'NFL Blitz','nflblitz.png','nflblitz.jpg',14,NULL,'NFL simulation game.'),(453,'Vagrant Story','vagrantstory.jpg','vagrantstory.jpg',15,NULL,'The kingdom of Valendia is engulfed in civil war. Leá Monde is an old town with a history spanning more than two millennia. Located on an island surrounded by reefs, the walls have been the \"witness of many battles\" and are \"stronger than the mightiest forts of Valendia\".'),(454,'Spider-Man Game Of The Year Edition','spider-mangameoftheyearedition.jpg','spider-mangameoftheyeareditionjpg',13,NULL,'Following Wilson Fisk\'s capture by Spider-Man, the Demons begin seizing Fisk\'s illicit assets. Mary Jane and Spider-Man learn that the Demons are seeking something called Devil\'s Breath.With the aid of Officer Jefferson Davis, Spider-Man thwarts a Demon attack.'),(457,'Disney Classic Games:Aladdin and The Lion King','disneyclassicgames:aladdinandthelionking.jpg','disneyclassicgames:aladdinandthelionking.jpg',6,NULL,'Based on Disney\'s fil Aladdin <br/>Based on Disney\'s film The Lion King'),(458,'Dino Crisis','dinocrisis.jpg','dinocrisis.png',10,NULL,'Dino Crisis takes place on a fictional location known as Ibis Island in the year 2009. The Secret Operation Raid Team (SORT) has sent an agent, Tom, to investigate a research facility.'),(459,'The X-Files',NULL,NULL,10,NULL,'The game takes place somewhere within the timeline of the third season of The X-Files series. The story follows a young Seattle-based FBI agent named Craig Willmore who is assigned by Assistant Director Walter Skinner to investigate the disappearance of agents Fox Mulder and Dana Scully, who were last seen in the Everett, Washington area.'),(460,'Final Fantasy X-2',NULL,NULL,11,NULL,'Two years after Sin\'s defeat, Yuna, Rikku and Paine recover Yuna\'s stolen Garment Grid from the Leblanc Syndicate in the first of several encounters in which they vie for spheres. The game is punctuated by a narration of Yuna addressing Tidus, as though she is recounting the events of the game to him as they occur.Meanwhile, the Gullwings discover an ancient sphere containing images of an enormous machina weapon called \"Vegnagun\" that was secretly buried beneath Bevelle.'),(463,'Brain Age 2','brainage2.png','brainage2.png',16,NULL,'Puzzle games.'),(464,'Carnival Games','carnivalgames.jpg','carnivalgames.jpg',16,NULL,'A frenzied combination of tapping, blowing, speaking and stylus maneuvering brings the now famous midway to life.'),(465,'Cooking Mama 2','cookingmama2.png','cookingmama2.jpg',16,NULL,'Cooking simulatin game with 55 recipes such as pan fried lobster, pierogie, cream puffs and sushi.'),(466,'Diddy Kong Racing DS','diddykongracingds.jpg','diddykongracingds.jpg',16,NULL,'Timber the Tiger\'s parents go on holiday and leave their son in charge of the island they live on, leaving him and his friends to organize a race.'),(467,'Final Fantasy III','finalfantasyiii.jpg','finalfantasyiii.jpg',16,NULL,'One thousand years before the events in the game, on a floating continent hovering high above the surface of an unnamed planet, a technologically advanced civilization sought to harness the power of the four elemental crystals of light.'),(468,'Final Fantasy IV','finalfantasyiv.jpg','finalfantasyiv.jpg',16,NULL,'The Red Wings attack the city of Mysidia to steal their Water Crystal, and return to the Kingdom of Baron. When Cecil, Captain of the Red Wings, afterwards questions the king\'s motives, he is stripped of his rank and sent with Kain, his friend and Captain of the Dragoons, to deliver a ring to the Village of Mist.'),(469,'Final Fantasy Tactics A2','finalfantasytacticsa2.jpg','finalfantasytacticsa2.jpg',16,NULL,'On the eve of leaving school for summer break, Luso is forced to stay at school and serve detention helping in the school library. Finding a half-empty book and writing his name in it as a prank, Luso is magically transported with the book into Ivalice.'),(470,'Final Fantasy XII Revenant Wings','finalfantasyxiirevenantwings.jpg','finalfantasyxiirevenantwings.jpg',16,NULL,'A year after the events of Final Fantasy XII, with Vaan flying his own airship with Penelo after Balthier and Fran \"stole\" the Strahl. The foursome is revisited in Bervenia and decide to accompany each other inside to obtain the Cache of Glabados.'),(471,'Gardening Mama','gardeningmama.jpg','gardeningmama.png',16,NULL,'Cooking simulation'),(472,'Guitar Hero on Tour','guitarheroontour.png','guitarheroontour.jpg',16,NULL,'Guitar playing simulaton'),(473,'Hannah Montana Music Jam','hannahmontanamusicjam.jpg','hannahmontanamusicjam.jpg',16,NULL,'Music simulation game'),(474,'Imagine Fashion Designer New York','imaginefashiondesignernewyork.jpg','imaginefashiondesignernewyork.jpg',16,NULL,'Fashion making game.'),(475,'I Spy Fun House','ispyfunhouse.jpg','ispyfunhouse.jpg',16,NULL,'Mini-games galore'),(476,'Mario Kart DS','mariokartds.jpg','mariokartds.jpg',16,NULL,'Racing simulation with Mario characters'),(477,'My Fashion Studio','myfashionstudio.jpg','myfashionstudio.jpg',16,NULL,'Fashion making game.'),(478,'My Pet Shop','mypetshop.jpg','mypetshop.jpg',16,NULL,'Players will explore various fields looking for animals to catch by using an assortment of items.'),(479,'My Sims Agents','mysimsagents.jpg','mysimsagents.jpg',16,NULL,'The player is a member of the Sim Protection Agency and must solve cases'),(480,'My Sims','mysimskingdom.jpg','mysimskingdom.jpg',16,NULL,'The game puts players in charge of redeveloping a town that has become run down. Through creative building and design elements, players can improve the town, which attracts new residents.'),(481,'My Sims Kingdom','mysimskingdom.jpg','mysimskingdom.jpg',16,NULL,'Begins with a character living in a run-down kingdom with a king desperate to bring happiness back.'),(482,'My Sims Party','mysimsparty.jpg','mysimsparty.jpg',16,NULL,'Takes place in a run-down town with the player tasked with the job of bringing residents into the island. This is accomplished by playing minigames for the locals who lives in your town and after you\'re done with a certain festival you earn stars.'),(483,'My Spanish Coach','myspanishcoach.jpg','myspanishcoach.jpg',16,NULL,'Learn spanish'),(484,'New Super Mario Bros','newsupermariobros.jpg','newsupermariobros.png',16,NULL,'Mario and Princess Peach are walking together when lightning suddenly strikes Peach\'s castle nearby. As Mario runs to investigate, Bowser Jr. appears, sneaking up on the Princess from behind and kidnapping her.'),(485,'Nintendogs','nintendogs.jpg','nintendogs.jpg',16,NULL,'Real time simulation to take care of virtual dogs'),(486,'Paws and Claw Pet Vet','pawsandclawpetvet.jpg','pawsandclawpetvet.jpg',16,NULL,'Run a pet clinic and must heal sick pets back to full health'),(487,'Pogo Island','pogoisland.jpg','pogoisland.jpg',16,NULL,'Mini-games'),(488,'Professor Layton And The Curious Village','professorlaytonandthecuriousvillage.jpg','professorlaytonandthecuriousvillage.png',16,NULL,'Driving to the town of St. Mystere, summoned by a letter from Lady Dahlia, widow of Baron Augustus Reinhold. The Baron stated in his last will and testament that whoever solves the mystery of the Golden Apple will inherit his fortune, and several people have attempted and failed.'),(489,'Professor Layton And The Diabolical Box','professorlaytonandthediabolicalbox.jpg','professorlaytonandthediabolicalbox.png',16,NULL,'Dr. Schrader, Professor Layton\'s mentor, reportedly has come across the mysterious Elysian Box, fabled to kill anyone who opens it. When Layton and Luke pay Dr. Schrader a visit, they find him unconscious on the floor and no sign of the box.'),(490,'Professor Layton And The Last Specter','professorlaytonandthelastspecter.png','professorlaytonandthelastspecter.png',16,NULL,'As the story begins, a woman named Emmy Altava is hired to be Professor Layton\'s assistant at the fictional Gressenheller University. Upon her introduction to him, he reveals that he is currently heading towards a town named Misthallery.'),(491,'Professor Layton And The Unwound Future','professorlaytonandtheunwoundfuture.png','professorlaytonandtheunwoundfuture.jpg',16,NULL,'As Layton and Luke are invited to witness a demonstration of a time machine built by Dr. Alain Stahngun, the experiment goes awry, causing the disappearance of Stahngun and the prime minister, Bill Hawks.'),(492,'Rhythm Heaven','rhythmheaven.png','rhythmheaven.jpg',16,NULL,'Rhythm game'),(493,'Sim Animals','simanimals.jpg','simanimals.jpg',16,NULL,'Embrace all the adventure, fun, and mischief that await you in the vast forest. You have the power to reach out and touch, pick up and move everything in the forest from squirrels and foxes to trees and flowers.'),(494,'The Legend of Zelda:Phantom Hourglass','thelegendofzelda:phantomhourglass.jpg','thelegendofzelda:phantomhourglass.jpg',16,NULL,'Picking up immediately after The Wind Waker, in which Link defeats Ganon who turns to stone and remains at the bottom of a now sealed away Hyrule, Link and Tetra travel over the flooded Hyrule called the Great Sea on board Tetra\'s pirate ship.'),(495,'The Sims 2 Castaway','thesims2castaway.jpg','thesims2castaway.jpg',16,NULL,'Stuck on a desert island'),(496,'The Sims 2','thesims2.jpg','thesims2.jpg',16,NULL,'Life simulation game.');
/*!40000 ALTER TABLE `video_games` ENABLE KEYS */;
